import React , {useContext} from 'react';
import {ThemeContext} from '../contexts/ThemeContext';

  const BookList = ()=>{
    const {isLightTheme, dark , light} = useContext(ThemeContext);
    const Theme = isLightTheme ? light : dark
    return(
        
        <div className="book-list"  style={{background:Theme.bg}}>
          
        <ul className="book-list" style={{background:Theme.bg}}>
            <li  style={{color:Theme.syntax}}>New Hero</li>
            <li style={{color:Theme.syntax}}>Accompany the Best</li>
            <li style={{color:Theme.syntax}}>Man of Valour</li>
            
        </ul>

      </div>
    )
  }

  export default BookList
